choices.text:
{
  "class": "AS3",
  "action": "deploy",
  "declaration": {
    "class": "ADC",
    "schemaVersion": "3.10.0",
    "id": "http_app",
    "remark": "HTTP App AS3 Declaration",
    "HTTP": {
      "class": "HTTP",
      "virtualServers": [
        {
          "name": "http-vs",
          "address": "10.0.0.2",
          "port": 80,
          "pool": "/Common/http-pool"
        }
      ],
      "profiles": [
        {
          "name": "profile-http",
          "class": "Profile_HTTP",
          "fallbackHost": false,
          "processAccounting": true,
          "setToken": false
        }
      ]
    },
    "Pools": {
      "class": "Pools",
      "pools": [
        {
          "name": "http-pool",
          "loadBalancingMode": "round-robin",
          "monitor": "/Common/http"
        }
      ]
    }
  }
}
